INSERT INTO `nahual` VALUES (0,'Tzikin','Pajaro','Nahual_0','<p>Es el Nawal del bienestar econ¢mico, la buena fortuna, d¡a propicio para agradecer y pedir el bienestar econ¢mico. Es la comunicaci¢n e intermediaci¢n entre Uk?ux Kaj y Uk?ux Ulew, el coraz¢n del cielo y el coraz¢n de la tierra. Personas que construyen su propio bienestar.</p>    <p><strong>Caracter¡sticas:</strong> Significa p jaro. Es el s¡mbolo de la suerte, la fortuna y los bienes materiales. Tambi‚n es s¡mbolo de libertad y es el nawal de las aves.</p>    <p>Simboliza el p jaro sagrado Q?uq?umatz. Este d¡a es propicio para pedir por la abundancia de los bienes como el dinero. Se quema el ajonjol¡ y el chocolate como ofrendas a Ajaw. Se encienden candelas de colmena pura y se le pide a Ajaw un buen negocio. Tz?ikin significa p jaro y simboliza la intermediaci¢n entre los seres humanos y Ajaw, representado por todo lo que hay en el espacio: el aire, las nubes, el fr¡o y el calor. Son fuerzas invisibles, pero que El Coraz¢n del Cielo y El Coraz¢n de la Tierra las ha puesto a nuestro servicio y protecci¢n.</p>    <p>Tambi‚n es un d¡a de desarrollo espiritual y, por tanto, de la plena realizaci¢n humana. Es el d¡a para agradecer los bienes materiales principalmente lo relacionado a dinero. Sin embargo, al no agradecer estos favores tambi‚n puede traer la miseria.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>Agradecimiento por los bienes materiales, principalmente lo del dinero.</li>  	<li>Propicia buena suerte en el negocio.</li>  	<li>D¡a de invocaci¢n porque las aves no molesten los sembrad¡os.</li>  	<li>D¡a para la protecci¢n del negocio.</li>  	<li>D¡a para realizar invocaciones para que las siembras est‚n protegidas de los animales.</li>  </ul>    <p><strong>Su origen:</strong> Kej <strong>destino:</strong> Aq\'ab\'al</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Es bueno para el negocio.</li>  	<li>Es mensajero, paciente y amable.</li>  	<li>De buen temperamento.</li>  	<li>Tiene habilidad para el an lisis y es buen observador.</li>  	<li>Desarrolla mejor su inteligencia.</li>  	<li>Puede tener dotes para la predicci¢n de las cosas.</li>  	<li>Puede ser afortunado en lo material.</li>  	<li>Puede tener bien desarrollado la parte espiritual.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Envidia</li>  	<li>Infidelidad</li>  	<li>Avaricia</li>  	<li>Taca¤er¡a</li>  	<li>En alg£n vicio</li>  </ul>'),(1,'Ajmaq','Buho, falta o culpa','Nahual_1','<p>Es el Nawal de todas las faltas, es el dia de los abuelos que ya no estan (difuntos). Es el dia para pedir perdón por las faltas. Personas valientes y de sangre dulce que facilmente caen en culpas</p>    <p><strong>Caracteristicas:</strong> Esta palabra significa pecador en K?iche?. Es el d¡a de los pecadores. Este d¡a se dedica a pedir perd¢n por los pecados y por los pecadores. Es el d¡a dedicado a los difuntos. El pecado es una columna de humo que nos oculta delante de la presencia de Dios. Nuestros antepasados dijieron: ?que el pecado es la ofensa que se hace directamente a Dios. No creer, no servir, no alabar al Corazon del Cielo, al coraz¢n de la Tierra. Mak es ofensa a Dios y Wuqub? qak?ix es ofensa al projimo?</p>    <p>Es el d¡a de los que no podemos ver, el d¡a de los difuntos. El d¡a de la fortaleza que nos da la historia de nuestro pasado. Tambi‚n es el d¡a del castigo cuando no estamos actuando en concordancia con las ense¤anzas que ellos nos legaron. Es el d¡a del enojo de los difuntos. (BEA)</p>    <p>?Ajmaq no es un mal d¡a. Es un d¡a para pedir perd¢n por los pecados. Son los d¡as en los cuales se reza por protecci¢n, ya que de estos d¡as puede venirle a uno, da¤o por sus pecados o sus malos pensamientos.</p>    <p>es la muerte en casa, la muerte natural por enfermedad, la muerte tranquila. En ese d¡a se habla con los difuntos, es para pedir perd¢n en el caso de los pecadores.</p>    <p><strong>Significa:</strong></p>    <ul>  	<li>Purificar el esp¡ritu de los muertos y vivos.</li>  	<li>D¡a para conmemorar los difuntos.</li>  	<li>Perd¢n para nuestros pecados.</li>  </ul>    <p><strong>Significado Clave:</strong> Autoridad y Estatus.</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Posee sabidur¡a, inteligencia</li>  	<li>Buena memoria</li>  	<li>Muy valiente</li>  	<li>Se les facilita el di logo</li>  	<li>Prudente, discreto</li>  	<li>Buenos maestros y consejeros</li>  	<li>Muy sociable</li>  	<li>Es profundo</li>  	<li>Es serio</li>  	<li>Realista</li>  	<li>Predicador</li>  	<li>Comunicativo</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Pecador</li>  	<li>Enamorado</li>  	<li>Alcohólico</li>  	<li>Destructores de la herencia</li>  	<li>Mentirosos</li>  	<li>Afamados</li>  	<li>Resentido</li>  	<li>Ladrn</li>  	<li>Adultero</li>  	<li>Frios e insensibles</li>  	<li>Minimizan los sentimientos de los demas</li>  	<li>Interesados en la autoridad y posicion social y politica</li>  </ul>'),(2,'Noj','Idea o sabiduria','Nahual_2','<p>Es el Nawal de la inteligencia, d¡a dedicado a pedir la sabidur¡a, el talento, el buen pensamiento. Es el Nawal del temblor o sismo. Personas muy creativas e imaginativas.</p>    <p><strong>Caracter¡sticas:</strong> Es la sabidur¡a y el conocimiento. Es el nawal de la inteligencia. Es el buen consejo, seg£n los abuelos y abuelas. Es la sabidur¡a que viene del Formador y Creador. Tambi‚n es uno de los Cargadores del Tiempo. D¡a propicio para agradecer el conocimiento y pedir buenos pensamientos.</p>    <p>El que nace bajo la influencia del No?j ser  inteligente, activo y tendr  buenos pensamientos, siempre y cuando sepa manejar las energ¡as del d¡a. Significa tambi‚n idea y sabidur¡a. Seg£n los mayas ning£n hombre es sabio. Por eso, el hombre, para recibir ideas y consejos, debe consultar al Ajaw por medio del ?xukulem? o la ceremonia maya. Tambi‚n puede realizar dichas consultas por medio del tz?ite?, mediante la intermediaci¢n del Ajq?ij, para recibir los consejos de los abuelos y abuelas. Dentro de la espiritualidad maya, el hombre tiene ideas pero no sabidur¡a. Por eso, es importante juntarse en consejo para unir ideas y formar as¡ una ciencia. Nuestros antepasados se reun¡an en consejo bajo la protecci¢n del No?j.</p>    <p>es el d¡a de la sabidur¡a. Es el d¡a para tomar decisiones de manera particular o en consejo. Es un d¡a que propicia la planificaci¢n de alg£n proyecto y de los lineamientos a seguir en la conducci¢n de la comunidad y de la sociedad en general. Tambi‚n es el d¡a en que nuestro pensamiento puede tener mayor fluidez.</p>    <p><strong>Funci¢n espiritual:</strong></p>    <ul>  	<li>Agradecer el conocimiento y las ideas.</li>  	<li>Agradecer la inteligencia.</li>  	<li>D¡a para acrecentar la memoria.</li>  	<li>Agradecer la inteligencia.</li>  	<li>D¡a para pedir buenos consejos.</li>  </ul>    <p><strong>Su origen:</strong> Toj <strong>destino:</strong> Kan</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Es poseedor de muchos conocimientos.</li>  	<li>Es inteligente y es consejero.</li>  	<li>Puede llegar a ser cient¡fico.</li>  	<li>Es ordenado y creativo.</li>  	<li>Es justo y humanista.</li>  	<li>Es buen estudiante.</li>  	<li>Puede llegar a ser un buen l¡der.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede caer en el orgullo.</li>  	<li>Se puede enojar con facilidad.</li>  	<li>Le cuesta tomar decisiones.</li>  	<li>Puede ser individualista y ego¡sta.</li>  </ul>'),(3,'Tijax','Pedernal o obsidiana','Nahual_3','<p>Nawal de la muerte repentina y los sufrimientos. D¡a propicio para curanderos y autoridades, para cortar males y enfermedades. Personas confrontativas que cortan toda clase de males y problemas.</p>    <p><strong>Caracter¡sticas:</strong> Significa piedra y obsidiana. Es el s¡mbolo del pedernal. Es la energ¡a de la persona que cura en la cultura maya. Es el poder del trueno y el rayo. La persona que nace bajo la influencia de este d¡a, puede ser un gran curandero o m‚dico con mucha energ¡a en las manos. Es ajq?¡j, cura enfermedades f¡sicas y psicol¢gicas. Puede arreglar fracturas de los huesos.</p>    <p>Una de las influencias negativas del d¡a es que puede causar alg£n sufrimiento o malestar. Seg£n los Ajq?ijab?, es un d¡a que ?come?. Para no ser alcanzado por estas influencias negativas debe hacerse alguna ofrenda y solicitar la intermediaci¢n del Gu¡a Espiritual.</p>    <p>Es un d¡a que puede evitar la humillaci¢n y la ruina a causa de algo o alguien. Es un d¡a de protecci¢n. Los que nacen es este d¡a pueden llegar a ser col‚ricos y pueden destruir espiritual o emocionalmente a alguien. A veces, nadie les aguanta y resulta dif¡cil comprenderlos.</p>    <p><strong>Su origen:</strong> Tz\'i <strong>destino:</strong> Keme</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Es protector de la justicia.</li>  	<li>Es fuerte y servicial.</li>  	<li>Es incansable por lo que quiere lograr.</li>  	<li>Puede llegar a ser Gu¡a Espiritual.</li>  	<li>Posee habilidad para arreglar fracturas en los huesos.</li>  	<li>Se puede defender muy bien ante cualquier problema.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede ser violento y enojado.</li>  	<li>Puede sufrir enfermedades.</li>  	<li>Puede ofenderse f cilmente.</li>  	<li>Puede caer en la venganza y en los pleitos.</li>  </ul>'),(4,'Kawoq','Trueno o dificultad','Nahual_4','<p>Es el Nawal de toda clase de pleitos, es el d¡a de la mujer, d¡a para curar enfermedades. Nawal de la piedra de cuarzo y de las semillas de Tz?it‚. Personas creativas, defensoras de la mujer.</p>    <p><strong>Caracter¡sticas:</strong> Es el nawal de la mujer como comadrona. Es el d¡a de la Vara Espiritual, le Pisom Q?aq?al. Es el rel&nbsp;mpago. Es la dualidad del fuego sagrado en funci¢n de la espiritualidad maya. Es el d¡a de la comunidad, de la familia, del grupo y de la sociedad. Es la energ¡a que facilita las lluvias para darnos buenas cosechas, principalmente la del ma¡z.</p>    <p>Proporciona capacidad y habilidad para curar y orientar. Es la energ¡a que fortalece a las Gu¡as Espirituales. Mantiene la energ¡a y la fertilidad. Es un d¡a de mucha relaci¢n con la Madre Tierra y los elementos al proveer sabidur¡a para el manejo de las plantas medicinales. Facilita la unidad y el cuidado de la familia. Es el d¡a de la mujer como esposa y madre que calienta el seno del hogar. Tambi‚n es un d¡a especial para la plena realizaci¢n de la mujer en la comunidad y en la sociedad.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>D¡a del terapeuta (el que arregla huesos) y de la comadrona.</li>  	<li>Uno de los d¡as para tratar enfermedades.</li>  	<li>D¡a para invocar por la familia (hogar) y la comunidad.</li>  	<li>Uno de los d¡as especiales para pedir lluvia.</li>  	<li>D¡a para invocar para que los ni¤os y ni¤as al nacer no vengan con defectos f¡sicos.</li>  </ul>    <p><strong>Su origen:</strong> B\'atz\' <strong>destino:</strong> Kej</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Es equilibrado y cari¤oso.</li>  	<li>Vive y trabaja por su familia.</li>  	<li>Si es mujer, puede ser comadrona.</li>  	<li>Puede llegar a ser Gu¡a Espiritual.</li>  	<li>Es buen comunicador y expositor.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede caer en el enojo.</li>  	<li>A veces es perseguido por los problemas y los pleitos.</li>  	<li>No es muy afortunado en el amor.</li>  	<li>Se le puede culpar de todo lo que pasa.</li>  	<li>Muy hablador.</li>  	<li>Se puede meter en donde no es llamado.</li>  </ul>'),(5,'Ajpu','Cerbatanero o se¤or principal','Nahual_5','<p>Es el Nawal de sol, d¡a para pedir sabidur¡a, talento y fortaleza f¡sica. Nawal de las flores, la m£sica, el deporte, los cazadores y la agricultura. Personas l¡deres, selectivas, buscan primero su beneficio.</p>    <p><strong>Caracter¡sticas:</strong> Es la luz y es la representaci¢n del Abuelo Sol. Significa cerbatanero, cazador, tirador y caminante. Es el d¡a de la fuerza corporal y del triunfo del bien sobre los obst culos. Es la representaci¢n del triunfo de Jun Ajpu e Ixbalamke sobre los se¤ores de Xib?alb?a. Esta se¤al le fue dada a la abuela Ixmukane cuando reto¤¢ el ca¤averal que sembraron los dos muchachos en el patio de la casa.</p>    <p>Es el d¡a del gran Ajaw, el padre y su representaci¢n solar, el d¡a de la grandeza, de la fuerza de la vida. Es el que trae luz y claridad a los seres humanos y sobre toda la humanidad.</p>    <p>Es la fuerza regenerativa, el ciclo de la vida. La facultad para tener a toda la galaxia. Rige los eclipses lunares y solares. Es el momento de servir a los dem s.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>D¡a para ofrendar a los abuelos y abuelas fallecidas.</li>  	<li>D¡a propicio para tratar enfermedades.</li>  	<li>Se pide la vida y la fuerza.</li>  	<li>D¡a para pedir el triunfo del bien sobre el mal.</li>  </ul>    <p><strong>Su origen:</strong> E <strong>destino:</strong> Q\'anil</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Puede desarrollar mejor la inteligencia.</li>  	<li>Puede tener dotes de artista.</li>  	<li>Es alegre.</li>  	<li>Se defiende muy bien.</li>  	<li>Puede llegar a ser Gu¡a Espiritual.</li>  	<li>Es bueno para la cacer¡a.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede caer en el enojo.</li>  	<li>Puede ser tajante.</li>  	<li>Es delicado.</li>  	<li>Puede enfermarse.</li>  	<li>Puede evadir responsabilidades.</li>  	<li>Le dificulta aceptar correcciones.</li>  	<li>Puede tener una actitud autosuficiencia.</li>  </ul>'),(6,'Imox','Locura o pez','Nahual_6','<p>El lado izquierdo. Es el Nawal del mar, r¡os y lagos, d¡a para sanar enfermedades de la mente, para agradecer y pedir la lluvia, enfermedades de la mente. El Nawal de todos los lugares donde est  el agua. No es el concepto de locura que conocemos com£nmente, es la capacidad de sentir lo que otros no sienten, por eso dicen que hablan locuras.</p>    <p><strong>Caracter¡sticas:</strong> S¡mbolo de las fuerzas ocultas del universo manifestadas en demencia. ?Imox? es el nombre de todas las cosas secretas. En general, es un d¡a de influencias negativas. Es un d¡a peligroso. Es s¡mbolo del hemisferio izquierdo, la parte sutil de los seres humanos, es la sensibilidad. Es la esencia de nuestra conciencia y de nuestra mente.</p>    <p>Es el nawal o esp¡ritu del agua. Genera movimiento pero, tambi‚n, descontrol emocional. Es un d¡a con influencias negativas y los que nacen en este d¡a pueden convertirse en busca pleitos. Por eso, el d¡a es propicio para las ceremonias de limpieza emocional.</p>    <p>Significa idiotez y locura. Es un d¡a especial para pedir la abundancia de agua. D¡a para invocar por los r¡os y nacimientos de agua para que no se sequen. Su trabajo es ayudar al hemisferio derecho del cerebro a realizar un mejor trabajo y a tomar una buena actitud.</p>    <p>Es el d¡a de la perturbaci¢n mental o de la equivocaci¢n. No es indicado para tomar decisiones. Es el d¡a en que se puede implorar y limpiar las perturbaciones provocadas por el enemigo en todos los ¢rdenes de la vida.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>Tratamiento de las perturbaciones mentales.</li>  	<li>D¡a especial para invocar por el agua.</li>  	<li>Invocaciones para mantener el equilibrio mental, espiritual, f¡sico y emocional.</li>  </ul>    <p><strong>Su origen:</strong> Aj <strong>destino:</strong> Toj</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Puede desarrollar la clarividencia.</li>  	<li>Puede captar los mensajes y se¤ales de la naturaleza.</li>  	<li>Puede desarrollar con mayor grado su hemisferio izquierdo.</li>  	<li>Puede tener buenas iniciativas.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Se le olvida con facilidad las cosas.</li>  	<li>Puede resultar muy inseguro.</li>  	<li>Puede tener reacciones violentas.</li>  	<li>Es ordenado en sus cosas.</li>  	<li>Puede tener un car cter variado.</li>  </ul>'),(7,'Iq','Viento o luna','Nahual_7','<p>Es el Nawal del aire y la luna, del esp¡ritu del ser humano. D¡a para alejar energ¡as malas y enfermedades. Es el viento que limpia nuestra casa y nuestro cuerpo.</p><p>\r     <strong>Caracter¡sticas:</strong>\r     Es el viento y la vida. Es nawal de la lluvia. Es el d¡a del Coraz¢n del Cielo y Coraz¢n de la Tierra. Es el aire y el soplo sagrado que da fuerza y vida.\r     En este d¡a se le pide al viento que se lleve los sufrimientos o las enfermedades de la persona.\r   </p>\r   <p>\r     Significa aire y aliento de vida. Tambi‚n, es el nawal de Junraqan (Hurac n) convertido en tornado. Es uno de los Cargadores del Tiempo.\r     Es, tambi‚n, la respiraci¢n de la persona. Es el soplo sagrado, suave y apacible purificador del cuerpo, de la mente, del esp¡ritu y de las emociones.\r     Es el espacio invisible existente entre la materia. Es uno de los elementos que produce los fen¢menos naturales.\r   </p>\r   <p>\r     El ni¤o que nace en Iq? es un ni¤o que hace de todo pero no llega a nada. Es como el aire que toca y arrastra todo lo que encuentra en su camino.\r     Puede construir pero tambi‚n destruye.\r   </p>\r   <p>\r     <strong>Funcion Espiritual:</strong>\r   </p>\r   <ul>\r     <li> Es d¡a propicio para efectuar ceremonias al esp¡ritu del aire o viento.</li>\r     <li> D¡a para tratar enfermedades respiratorias, psicol¢gicas y emocionales.</li>\r     <li> D¡a de invocaci¢n para que el aire no destruya las siembras.</li>\r   </ul>\r   <p><strong>Su origen:</strong> I\'x <strong>destino:</strong> Tz\'i\'</p>\r   <p>\r     <strong>Fortalezas:</strong>\r   </p>\r   <ul>\r     <li> Puede adaptarse a cualquier situaci¢n.</li>\r     <li> Posee fuerza f¡sica.</li>\r     <li> Es so¤ador e imaginativo.</li>\r     <li> Puede tener ideas futuristas.</li>\r     <li> No asusta casi nada.</li>\r   </ul>\r   <p>\r     <strong>Debilidades:</strong>\r   </p>\r   <ul>\r     <li> De car cter muy fuerte.</li>\r     <li> Puede resultar inseguro e impulsivo.</li>\r     <li> Puede caer en la infidelidad con su pareja.</li>\r     <li> Puede sufrir algunos problemas sociales y econ¢micos.</li>\r     <li> Le encanta decir directamente las cosas.</li>\r   </ul>'),(8,'Aqabal','Amanecer, aurora y mano','Nahual_8','<p>Es el Nawal de la claridad, d¡a para pedir que salga la luz en todas las cosas. El d¡a de las personas que componen los huesos de los enfermos y de los curanderos con plantas. Personas que cumplen sus compromisos.</p>    <p><strong>Caracter¡sticas:</strong> Es el s¡mbolo de la mano y de la aurora formada por los primeros rayos del sol que se asoman sobre las monta¤as para disipar las tinieblas y la oscuridad de la noche.</p>    <p>Significa amanecer, aurora, luz, claridad, nuevo d¡a. Es la renovaci¢n de energ¡a. Es la llegada de la luz, del crep£sculo, la luz que se asoma detr s de los cerros y monta¤as.</p>    <p>Es el d¡a del amanecer, del futuro promisorio que esperamos cada d¡a, los mejores d¡as para nuestro pueblo y para cada persona en particular.</p>    <p><strong>Funci¢n Espiritual:</strong></p>    <ul>  	<li>Aclara los conocimientos.</li>  	<li>Aclara el camino de la vida.</li>  	<li>Conduce a nuevas oportunidades de la vida.</li>  	<li>Ilumina las cosas ocultas.</li>  	<li>D¡a para agradecer la creaci¢n del ser humano.</li>  </ul>    <p><strong>Su origen:</strong> Tzikin <strong>destino:</strong> Batz</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Es madrugador, alegre y sereno.</li>  	<li>Puede tener buen car cter.</li>  	<li>Puede tener dotes para tratar enfermedades.</li>  	<li>Puede ser Gu¡a Espiritual.</li>  	<li>Son fuertes, din micos y astutos.</li>  	<li>Puede tener seguridad mental y f¡sica.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>No es bien reconocido en su tierra.</li>  	<li>Puede encontrar el fracaso.</li>  	<li>Puede caer en la mentira y la traici¢n.</li>  	<li>Puede tener dificultades en lo econ¢mico.</li>  	<li>Es un poco reservado y aislado.</li>  </ul>.'),(9,'Kat','Red, cautiverio o iguana','Nahual_9','<p>Es el Nawal de las c rceles visibles e invisibles. Es guardador. Representa la red donde se guarda el ma¡z y donde se atrapan los peces. D¡a para pedir por los que est n presos, para enredar y desenredar las cosas. Personas con mucho fuego en su ser. Manejan energ¡as positivas y negativas.</p>    <p><strong>Caracter¡sticas:</strong> Est  relacionado con la palabra k?atik que significa arder. S¡mbolo del fuego y de la red. En el ritual se hace menci¢n del d¡a como tiempo para el enredo y el desenredo. Es el que enreda y desenreda la vida.</p>    <p>Es la red donde se guarda la mazorca. La red con la que se pesca. La red donde mueren los peces. Significa cautiverio y ausencia de libertad. Signo de opresi¢n que se ejerce sobre una comunidad.</p>    <p>Es el trastecito o el bracero que le entregan a uno cuando recibe el Pisom Q?aq?al o la Vara Sagrada. Para los nacidos en K?at, en la espiritualidad maya, se les recomienda visitar al Ajq?ij cada veinte d¡as para efectuar su ceremonia. De lo contrario, pueden tener muchos enredos en el camino, en el trabajo y en la vida.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>Se puede pedir por la liberaci¢n de alg£n preso.</li>  	<li>Pedir porque el parto sea normal.</li>  	<li>D¡a del desenvolvimiento e investigaci¢n de la ciencia.</li>  	<li>D¡a para arreglar problemas emocionales y de amor.</li>  </ul>    <p><strong>Su origen:</strong> Ajmaq <strong>destino:</strong> E</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Persona sincera y ordenada.</li>  	<li>Puede ser l¡der.</li>  	<li>Puede ser una persona muy afortunada en lo econ¢mico.</li>  	<li>Puede ser Gu¡a Espiritual.</li>  	<li>Persona muy activa y curiosa.</li>  	<li>Puede recordar las cosas facilidad.</li>  	<li>Puede ser muy tajante en su decisi¢n.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede caer en los chismes y en el enojo.</li>  	<li>Puede resultar nervioso.</li>  	<li>Puede perder las cosas con facilidad.</li>  	<li>Puede estar propenso a malas influencias.</li>  	<li>Puede caer en el individualismo.</li>  	<li>Puede caer en elorgullo.</li>  	<li>Con tendencia a meterse en los problemas ajenos.</li>  </ul>'),(10,'Kan','Serpiente emplumada','Nahual_10','<p>Es el Nawal de la creaci¢n del hombre y la mujer. Es el due¤o de todas las cosas materiales. D¡a para pedir soluci¢n a toda clase de problemas y necesidades. Personas con un alto sentido de la lealtad.</p>    <p><strong>Caracter¡sticas:</strong> Significa movimiento, Es el s¡mbolo de la Gran Energ¡a que cre¢ el Universo. Es la Serpiente Emplumada o Q?uq?umatz. Es la evaluaci¢n humana y el desarrollo espiritual. Es la Sabidur¡a y el ciclo del tiempo. Es guardi n del bosque. Es el d¡a de la transformaci¢n.</p>    <p>significa justicia y equilibrio. Es un d¡a muy fuerte y ?enojado?. Es un d¡a que puede traer malas influencias como el enojo y la ri¤a. Sin embargo, es un s¡mbolo de la verdad y es r pido e implacable cuando la justicia se¤ala a alguien el lugar de los perdedores. La energ¡a del d¡a se presta para la soluci¢n de problemas.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>Invocaciones por la igualdad y justicia.</li>  	<li>D¡a para desarrollar la fuerza f¡sica.</li>  	<li>D¡a para desarrollar el fuego interior y la evoluci¢n espiritual.</li>  	<li>Uno de los d¡as para realizar invocaciones por la lluvia.</li>  	<li>D¡a para alejar el enojo, la timidez y el mal car cter.</li>  </ul>    <p><strong>Su origen:</strong> No\'j <strong>destino:</strong> Aj</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Persona con mucho conocimiento.</li>  	<li>Puede tener mucha habilidad para la intuici¢n.</li>  	<li>Muy inteligente.</li>  	<li>Practica la sinceridad y la justicia.</li>  	<li>Puede llegar a ser l¡der.</li>  	<li>Puede tener habilidad para los pron¢sticos y la clarividencia.</li>  	<li>Puede ser Gu¡a Espiritual.</li>  	<li>Es humilde.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede estar influenciado por el enojo y la traici¢n.</li>  	<li>Puede caer en el resentimiento y la avaricia.</li>  	<li>Es desconfiado y sorpresivo.</li>  </ul>'),(11,'Kame','Muerte o due¤o de la oscuridad','Nahual_11','<p>Es el Nawal de toda clase de muertes, d¡a para pedir que se aleje la muerte. Se pide el descanso y paz de un moribundo. La Muerte no es mala, es el complemento de la vida, el descanso. Es el d¡a para retirar energ¡as negativas en las personas. Personas con habilidad para las artes y oficios.</p>    <p><strong>Caracter¡sticas:</strong> Es el s¡mbolo de la muerte. S¡mbolo de la disoluci¢n final de todas las cosas, buenas y malas. Significa tecolote y muerte. Es el renacimiento. Significado que se expresa a trav‚s de los sagrados granos de Tz?ite? o Palo de Pito. Es d¡a propicio para pedir por la salud de los enfermos y para hacer ofrendas porque progrese el negocio.</p>    <p>Es la energ¡a de las personas que mueren de manera natural. Puede restar fuerza a una persona o fortalecerla. Pronostica lo bueno y lo malo. Es la comunicaci¢n con las abuelas y abuelos a trav‚s de las candelas de cebo que se ofrecen en las ceremonias. Prudencia y protecci¢n para evitar accidentes. Es el Juez Supremo de todas las cosas. Nawal de la enfermedad y de la muerte.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>Es un d¡a bueno para el negocio.</li>  	<li>D¡a especial para comunicarse con los ancestros.</li>  	<li>Fortalecimiento de la vida.</li>  	<li>D¡a para pedir protecci¢n en los viajes.</li>  	<li>D¡a para contrarrestar enfermedades.</li>  </ul>    <p><strong>Su origen:</strong> Tijax <strong>destino:</strong> I?x</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Puede ser m‚dico.</li>  	<li>Es fuerte ante sus enemigos.</li>  	<li>Es inteligente, respetuoso y seguro.</li>  	<li>Puede controlarse.</li>  	<li>Puede desarrollar habilidades para la clarividencia.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede tener un temperamento fuerte.</li>  	<li>Propenso al suicidio.</li>  	<li>Puede sufrir mucho al no cumplir con sus obligaciones con la Madre Naturaleza.</li>  	<li>Puede tener tendencias a la mentira y a la infidelidad con su pareja.</li>  </ul>'),(12,'Kej','Venado','Nahual_12','<p>Es la autoridad de la comunidad. Es el nawal de toda clase de animales cuadr£pedos. D¡a para pedir fuerza para cargar con nuestras penas. Nawal de las cuatro esquinas del mundo. D¡a de los Ajq¡jab? o sacerdotes mayas. Personas l¡deres, dominantes con su pareja, les gusta la fama.</p>    <p><strong>Caracter¡sticas:</strong> El nawal del Kej es muy masculino y si una mujer nace en este d¡a, tiene el car cter y voz fuertes y es de alguna manera varonil.</p>    <p>Simboliza venado, los cuatro sostenes, los cuatro pilares, es decir los cuatro puntos cardinales. Es el d¡a fuerte y bueno. Es un d¡a que aplasta. Es un d¡a que demuestra su fuerza y su poder.</p>    <p>Los que nacen en este d¡a: son de caracter fuerte y poseen fortaleza f¡sica. Son buenos defensores de otras personas, pero no pueden defenderse a s¡ mismos. pueden ser ricos y poseer muchos bienes. generalmente gozan de buena salud pues no se enferman con facilidad.</p>    <p>Son los cuatro puntos cardinales que sostienen el mundo; sostiene la vida del hombre. Los que nacen en este d¡a son caminantes y tienen suerte en el negocio.</p>    <p>Es el d¡a en que se pide fuerza, fortalecimiento, endurecimiento, para que uno sea duro, aguantador en caso de enfermedades, golpes, cr¡ticas, que uno aguante lo duro de la vida. Los que nacen en Kej podr¡an ser buenos gu¡as espirituales mayas.</p>    <p><strong>Significado:</strong></p>    <ul>  	<li>La cruz maya.</li>  	<li>Los cuatro puntos cardinales.</li>  	<li>Los cuatro sostenes de la tierra.</li>  	<li>Nawal de los defensores.</li>  	<li>Los cuatro colores de las energ¡as.</li>  	<li>Caballo, fuerza, aguantador.</li>  </ul>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Buenos defensores</li>  	<li>Poseen riquezas</li>  	<li>Gozan de buena salud</li>  	<li>Son buenos gu¡as espirituales</li>  	<li>Son muy sociables</li>  	<li>Son fuertes, inteligentes, responsables, positivos y triunfadores.</li>  	<li>En el matrimonio son muy equilibrados</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede hacer el mal con su pensamiento</li>  	<li>Tiene un car cter fuerte</li>  	<li>Pueden ser muy compulsivos</li>  	<li>Les gusta la popularidad y el poder</li>  	<li>Podr¡an ser autocr ticos, manipuladores etc.</li>  	<li>Les gusta la comodidad</li>  	<li>Son muy reservados</li>  	<li>Autoritarios</li>  	<li>Suelen ser exigentes</li>  	<li>Les gusta hundir y aplastar a las personas.</li>  	<li>Podr¡an ser necios</li>  </ul>'),(13,'Qanil','Semilla, simiente o conejo','Nahual_13','<p>El planeta Venus. Es el Nawal de toda clase de semillas animales y vegetales. D¡a de la fertilidad y las cosechas, propicio para iniciar cualquier siembra o negocio. Significa los cuatro colores del ma¡z, rojo, negro, blanco y amarillo. Personas de mano ?caliente? a quienes todo lo que siembran les florece.</p>    <p><strong>Caracter¡sticas:</strong> Este es un d¡a propicio para las rogativas que se hacen con relaci¢n al ma¡z y para darle gracias a la divinidad de la tierra, por la cosecha de ma¡z.</p>    <p>Es el nawal de las cosechas. El que nace en este d¡a es buen agricultor. Hay que buscar este tanto para la siembra como para la cosecha del ma¡z.</p>    <p>Simboliza los cuatro colores del ma¡z existentes en Meso Am‚rica: rojo, negro, blanco y amarillo. Los cuatro colores de la piel de la humanidad. Los cuatro puntos cardinales del universo. En este d¡a se pide buena cosecha. Es el d¡a del agricultor.</p>    <p><strong>Significado:</strong></p>    <ul>  	<li>Nawal de la semilla.</li>  	<li>germinaci¢n de todos los seres vivientes.</li>  	<li>D¡a de la construcci¢n de los primeros abuelos del ma¡z.</li>  </ul>    <p><strong>Dia de:</strong> La Fecundaci¢n y de La Germinaci¢n.</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Afortunados en las siembras o crianza de animales</li>  	<li>Muy f‚rtiles en tener hijos</li>  	<li>Son buenos comerciantes</li>  	<li>suelen tener Signos de intensa energ¡a en su cuerpo</li>  	<li>Extremadamente inteligentes</li>  	<li>Les gusta hablar, debatir, leer, escribir</li>  	<li>Aficionados al ejercicio f¡sico o la danza</li>  	<li>Mente compleja</li>  	<li>Se interesan de detalles</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Padecen de dolor de cabeza, resfriados</li>  	<li>Podr¡an destruir su propio hogar</li>  	<li>Incr‚dulos</li>  	<li>Creen en su imaginaci¢n</li>  	<li>Regularmente son nerviosos</li>  	<li>Pueden ser cobardes</li>  	<li>Autodestructivos</li>  	<li>Evitan las grandes responsabilidades</li>  	<li>Propensos a adquirir vicios relacionados con estimulantes</li>  	<li>Muy agresivos, enojados</li>  	<li>A veces son obsesivos, compulsivos</li>  	<li>Llegan a donde no son llamados</li>  	<li>Orgullosos</li>  	<li>Suelen ser ego¡stas</li>  </ul>    <div id=\"simple-translate\">  <div>  <div class=\"simple-translate-button isShow\" style=\"background-image: url(&quot;chrome-extension://cllnohpbfenopiakdcjmjcbaeapmkcdl/icons/512.png&quot;); height: 22px; width: 22px; top: 55px; left: 449px;\"> </div>    <div class=\"simple-translate-panel\" style=\"width: 300px; height: 200px; top: 0px; left: 0px; font-size: 13px; background-color: rgb(24, 24, 24);\">  <div class=\"simple-translate-result-wrapper\" style=\"overflow: hidden;\">  <div class=\"simple-translate-move\" draggable=\"true\"> </div>    <div class=\"simple-translate-result-contents\">  <p class=\"simple-translate-result\" style=\"color: rgb(230, 230, 230);\"> </p>    <p class=\"simple-translate-candidate\" style=\"color: rgb(170, 170, 170);\"> </p>  </div>  </div>  </div>  </div>  </div>'),(14,'Toj','Ofrenda, pago o lluvia','Nahual_14','<p>Es el Nawal de los cuatro se¤ores del fuego, Tojil, Awilix, Jakawitz? y Nikajtakaj. D¡a propicio para nivelar o pagar cualquier deuda. D¡a en que se agradece todo lo que recibimos en nuestra vida, lo bueno y lo malo. Personas con mucha sensibilidad para las artes y que lloran con facilidad.</p>    <p><strong>Caracter¡sticas:</strong> Significa pago, ofrenda y agradecimiento. Se ponen presentes para el pago de alguna culpa o para enmendar alg£n error.</p>    <p>Es el d¡a especial de las ofrendas. Se agradece el sol, el agua, el aire, el alimento y todo lo que nos rodea y lo que hemos recibido de la Madre Tierra. Los que nacen en Toj, algunas veces, son los que pagan la deuda de la familia, por eso es que pueden sufrir problemas de salud.</p>    <p><strong>Funci¢n Espiritual:</strong></p>    <ul>  	<li>Agradecimiento a Ajaw por los beneficios recibidos.</li>  	<li>D¡a para ponerse en paz con Ajaw, con los abuelos y abuelas y con el pr¢jimo.</li>  	<li>Se hacen ceremonias para lograr el equilibrio, moral y espiritual.</li>  	<li>D¡a para retirar los sufrimientos, accidentes y enfermedades.</li>  </ul>    <p><strong>Su origen:</strong> Imox <strong>destino:</strong> No\'j</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>De grandes virtudes.</li>  	<li>Es creativo, comunicativo y din mico.</li>  	<li>Practica la sinceridad.</li>  	<li>Es analista, imaginativo e intuitivo.</li>  	<li>De car cter abierta.</li>  	<li>Es rom ntico.</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede sufrir enfermedades.</li>  	<li>Puede caer en la miseria.</li>  	<li>Puede tener inestabilidad mental.</li>  	<li>Puede estar expuesto a accidentes.</li>  	<li>Puede caer en el orgullo y la vanidad.</li>  	<li>Vicioso y orgulloso</li>  </ul>'),(15,'Tzi','Perro o mapache','Nahual_15','<p>(Algunos abuelos tambi‚n dicen que es TZIJ = palabra). Es el Nawal de la justicia, la autoridad material y espiritual, el orden. D¡a para pedir la soluci¢n a los problemas ante los tribunales. D¡a para alejar los vicios. Son las personas que hablan por otros. Los due¤os de las leyes. Juzgan a los dem s.</p>    <p><strong>Caracter¡sticas:</strong> El antiguo significado de Tz?i? es tepescuintle. En idioma k?iche? es Lalo. Guardi n de la milpa de la abuela Ixmukane de donde Ixk?ik? trajo la red llena de mazorcas, y que le ayud¢ a cumplir con su tarea de una manera m gica. En el Popol Wuj significa Jun Ajpu Wuch?, cazador tacuac¡n y Jun Ajpu Utiw, cazador coyote. Tambi‚n es guardi n de los cerros, las monta¤as, las veredas y los barrancos.</p>    <p>Es la fidelidad, la autoridad y la ley. Por tanto, es el guardi n de la ley natural y espiritual. Hace los papeles de secretario.</p>    <p>Puede influir en excesivas conductas sexuales. Por eso, algunos Gu¡as Espirituales le atribuyen como s¡mbolo del pecado, especialmente de impureza sexual. El que nace en este d¡a puede resultar muy sexual, sea hombre o mujer. La intensidad de esta conducta depender  del numeral que acompa¤a al Tz?i? como d¡a de nacimiento.</p>    <p><strong>Funci¢n Espiritual:</strong></p>    <ul>  	<li>Invocar por el orden y la exactitud.</li>  	<li>Puede interpretar lo conocido y lo desconocido.</li>  	<li>Se invoca el d¡a para que gu¡e y cuide el camino.</li>  	<li>D¡a para contrarrestar calumnias y ofensas.</li>  	<li>D¡a de protecci¢n ante la ley.</li>  </ul>    <p><strong>Su origen:</strong> Iq\' <strong>destino:</strong> Tijax</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Atento, valiente, respetado, justo.</li>  	<li>Es defensor de otras personas.</li>  	<li>Es cordial.</li>  	<li>Logra lo que busca.</li>  	<li>Buen investigador y presiente las cosas o actos.</li>  	<li>Enamorado.</li>  	<li>Es el d¡a de los abogados</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Puede resultar vicioso e infiel.</li>  	<li>Puede caer en la mentira.</li>  	<li>Puede tener mucha tendencia sexual.</li>  	<li>Puede resultar con temperamento fuerte.</li>  </ul>'),(16,'Batz','Mono o hilo','Nahual_16','<p>Es el Nawal de todas las artes, de los tejidos, de los artistas. Es un d¡a propicio para pedir pareja, amarrar o desatar cualquier asunto. Son maestros de todas las artes.</p>    <p><strong>Caracter¡sticas:</strong> Es el s¡mbolo del hombre y de la humanidad, de la realizaci¢n del hombre.</p>    <p>S¡mbolo de continuidad con el pasado, como se ha englobado dentro del ritual. ?Un buen d¡a, de la perpetraci¢n de las ceremonias y costumbres de nuestros antepasados.</p>    <p>Es el d¡a en que se realiza aquella parte del matrimonio en que se pide la novia, y el casamiento cuarenta d¡as despu‚s, en un d¡a B?atz? con un n£mero m s alto. En 8 B?atz? se presenta p£blicamente el aprendiz de sacerdote maya, y cuarenta d¡as despu‚s se realiza el agradecimiento.</p>    <p>Simboliza el tiempo. Nuestros antepasados, los mayas representaron el tiempo imagin ndolo como un hilo enrollado a un carrizo que se encuentra debajo de la tierra. Este hilo se va desenrollando a medida que el tiempo pasa. La historia se teje con el tiempo, as¡ como el hilo teje los vestidos. El ciclo Nuevo Maya, Wajxaqib? B?atz?, en la ceremonia se ameniza con marimba y se baila alrededor del fuego. El B?atz? amarra y desata. Se le dice B?atz? porque gira. Y es el talento del ser humano.</p>    <p><strong>Significa:</strong></p>    <ul>  	<li>Enlace matrimonial</li>  	<li>Mono, hilo, amarrador</li>  	<li>El tiempo. desarrollo de la evoluci¢n humana, d ndonos la vida</li>  	<li>Nawal de medidor del tiempo y de toda clase de tejidos</li>  	<li>Es un buen d¡a para recibir el destino como sacerdote Maya</li>  	<li>Orador, escultor, tallador y artista, m£sica, flauta, deporte y siembra.</li>  </ul>    <p><strong>Significado Clave:</strong> La representaci¢n y el talento art¡stico</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Inteligente, astuto</li>  	<li>Amable</li>  	<li>Reservado</li>  	<li>Suelen imitar lo que ven</li>  	<li>Tienen buenas se¤ales</li>  	<li>Adinerados (Ricos)</li>  	<li>Maestros de todas las artes</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Inseguro</li>  	<li>Harag n</li>  	<li>Enojado, agresivo</li>  	<li>Envidioso, calumniador</li>  	<li>Mala imaginaci¢n, incr‚dulo</li>  	<li>Ambicioso de cualquier cosa</li>  	<li>D‚bil de voluntad</li>  </ul>'),(17,'E','Camino o diente','Nahual_17','<p>Es el Nawal de todos los caminos y dirigentes. Del sistema nervioso y sanguíneo. Día propicio para iniciar cualquier viaje o negocio. Son líderes naturales.</p>    <p><strong>Características:</strong> Simboliza el camino y el destino. Es el guía. Es el que nos lleva a un punto fijo. Uno de los Cargadores del Tiempo. Es la protección de los viajeros y caminantes. Conduce la vida espiritual y material.</p>    <p>Es el que hace posible la realización humana en todos los órdenes y en todas las manifestaciones. Pero también puede simbolizar los obstáculos con que los seres humanos se tropiezan en la continua búsqueda de esa realización.</p>    <p>Es un día bueno para desplazarse en cualquier lugar. En caso de peligro, el Ajaw E es el que da la protección. También es día bueno para agradecer el bienestar físico, la vida misma de las personas y el trabajo. Es un día muy sagrado. Por esta razón, se puede pedir su protección, como dice el Popol Wuj “que no se caigan en la bajada ni en la subida del camino. Que no encuentren obstáculos ni detrás ni delante de ellos, ni cosa que los golpee. Concédeles buenos caminos, hermosos caminos planos…”.</p>    <p>Es el viaje, la travesía y el trayecto. Se ofrecen ceremonias o invocaciones para que limpie el camino de los peligros y de los accidentes.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>Protección ante las tentaciones</li>  	<li>Protección ante los peligros del camino</li>  	<li>Día para iniciar un proyecto</li>  	<li>Día de protección de los pilotos</li>  	<li>Día para encauzar mejor el destino</li>  </ul>    <p><strong>Su origen:</strong> K\'at <strong>destino:</strong> Ajpu</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Es amable y trabajador</li>  	<li>Es guía y consejero</li>  	<li>Es cariñoso y alegre</li>  	<li>Es viajero y puede ser comerciante</li>  	<li>Afortunado, decidido, comprensivo</li>  	<li>Cuidadoso en las cosas</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Desconfiado e inseguro</li>  	<li>Algunas veces se puede resentir</li>  	<li>Es variable con su carácter</li>  	<li>Es nervioso y frágil</li>  	<li>Impaciente en algunas ocasiones</li>  </ul>'),(18,'Aj','Caña o cañaveral','Nahual_18','<p>Es el Nawal de la casa y de los niños, día propicio para el hogar y la salud de los niños. Nawal de las generaciones tiernas. Personas que no pueden negarse ante otros.</p>    <p><strong>Características:</strong> Simboliza caña veral y milpa. Todo lo que se relaciona al hogar y la familia. Es el símbolo que dejó Jun Ajpu Ixb’alamkej de su vida, cuando sembró la caña en medio del patio de la casa de la abuela Ixmukane. Aj es símbolo de la resurrección de Jun Ajpu e Ixb’alamkej, quienes no murieron en manos de los señores de Xib’alb’a. Es el triunfo del bien sobre el mal.</p>    <p>Es el destino representado por el Nawal o los Nawales. 8 Aj es el día en el cual se establece el destino de uno, para llamarlo y reconocerlo.</p>    <p>también es elote, maíz tierno. Día relacionado con todo lo que concierne a los niños. Es día bueno y sobre todo para rezar por las criaturas.</p>    <p>También es el día de la enfermedad debilidad en el tejido óseo, pero de mucha energía espiritual. Es el hogar, la casa, todo lo que se relaciona con la casa. Los que nacen en Aj pueden ser sacerdotes mayas.</p>    <p><strong>Funcion Espiritual:</strong></p>    <ul>  	<li>El hogar y la familia de todas las generaciones tiernas; 8 Aj se celebra el día del niño.</li>  	<li>El bastón del poder de las virtudes divinas, sensatez, la palabra sagrada.</li>  	<li>Caña, símbolo que dejó Jun Ajpu Ixbalanke de su vida, cuando sembró la caña en el patio, dueño del Hogar, y ternura.</li>  	<li>Nawal de las artes.</li>  </ul>    <p><strong>Significado Clave:</strong> La integridad de la fe</p>    <p><strong>Fortalezas:</strong></p>    <ul>  	<li>Autoridad</li>  	<li>Inteligente</li>  	<li>Estricto</li>  	<li>Es respetado por sus amigos</li>  	<li>Principios sólidos en el terreno moral y ético</li>  	<li>Atraído por la religión o los estudios filosóficos y teológicos</li>  	<li>Trabajador</li>  	<li>Bromista</li>  </ul>    <p><strong>Debilidades:</strong></p>    <ul>  	<li>Regaña</li>  	<li>Celoso</li>  	<li>Nervioso</li>  	<li>Expuesto a discutir y juzgar</li>  	<li>Hace lo que le plazca</li>  	<li>Extremista, no es de moderación</li>  	<li>Hace bromas pesadas</li>  	<li>No es constante en la fe</li>  	<li>Variable</li>  	<li>Sufre con frecuencia, se enferma en la niñez</li>  	<li>Alcohólico</li>  	<li>Destructor</li>  	<li>Una vida variable, de dolor</li>  	<li>tristeza y alegría</li>  </ul>'),(19,'Ix','Jaguar','Nahual_19','<p>Es el Nawal de la naturaleza y los altares mayas, día para pedir fortaleza física y mental.</p><p>\r     <strong>Características:</strong>\r     Es el símbolo y energía de la Madre Tierra. Representa los lugares o centros ceremoniales donde se llevan a cabo las ceremonias.\r     Son los cerros, las montañas, las planicies. Significa Jaguar.\r   </p>\r   <p>\r     Representa el altar maya o sea el tab’al. Es un día especial para pedir la vida de los animales tanto domésticos como salvajes.\r     Se le pide a Ajaw una buena cosecha de cualquier cultivo, en especial el de las verduras.\r     En este día se encienden candelas de color verde, ya que simbolizan el color de la Madre Tierra.\r   </p>\r   <p>\r     Representa el altar maya o sea el tab’al. Es un día especial para pedir la vida de los animales tanto domésticos como salvajes.\r     Se le pide a Ajaw una buena cosecha de cualquier cultivo, en especial el de las verduras. En este día se encienden\r     candelas de color verde, ya que simbolizan el color de la Madre Tierra.\r   </p>\r   <p>\r     <strong>Funcion Espiritual:</strong>\r   </p>\r   <ul>\r     <li> Propicia energía espiritual y física.</li>\r     <li> Invocación por la lluvia.</li>\r     <li> Invocación por la vida de los animales.</li>\r     <li> Día de invocación por la salud de toda la humanidad.</li>\r     <li> Día para realizar invocaciones para que las siembras estén protegidas de los animales.</li>\r   </ul>\r   <p><strong>Su origen:</strong> Keme <strong>destino:</strong> Iq\'</p>\r   <p>\r     <strong>Fortalezas:</strong>\r   </p>\r   <ul>\r     <li> Es paciente, fuerte, responsable, valiente, respetuoso, vigoroso y atrevido.</li>\r     <li> Es decisivo y realista.</li>\r     <li> Es de buen corazón.</li>\r     <li> Buen padre de familia.</li>\r     <li> Puede ser líder y famoso si sabe encauzar sus energías.</li>\r   </ul>\r   <p>\r     <strong>Debilidades:</strong>\r   </p>\r   <ul>\r     <li> Puede llegar a tener un carácter fuerte.</li>\r     <li> Algunas veces se enoja y se impacienta.</li>\r     <li> Su carácter le puede hacer prepotente, orgulloso, colérico, serio y vengativo.</li>\r   </ul>\"');
