INSERT INTO `periodo` VALUES ('Clasico','292','D.C','900','D.C','Clasico',NULL,2,'<p>Las tierras bajas del centro y del sur alcanzaron su máximo esplendor. Durante el periodo clásico surgen en la sociedad maya los artesanos, arquitectos, pintores y artistas canteros, especialistas en la producción y en el servicio.</p>'),('PosClasico','900','D.C','1541','D.C','PosClasico',NULL,3,'<p>Durante el periodo posclásico los mayas orientaron más sus energías a la producción y el comercio y menos a la monumentalidad de sus construcciones. </p>'),('PreClasico','1500','A.C','292','D.C','PreClasico','<p>El período <strong>Preclásico Temprano</strong> indica el momento en que las sociedades mayas contaron con rasgos culturales propios que los distinguen de otros grupos mesoamericanos. Las sociedades son ya aldeas agrícolas sedentarias, por lo que aparece por primera vez la cerámica. En la Costa Pacífica este período inicia alrededor del año 1,800 a.C., pero en el resto del área Maya se define a partir del 1,000 o 1,200 a.C.</p>',1,'<p>Las primeras manifestaciones de vida sedentaria en el área maya se desarrollaron en la región Costa del Pacífico y del Piamonte y corresponden al periodo preclásico.</p>');
