INSERT INTO `uinal` VALUES (0,'Uayeb','Dias desafortunados','Uinal_0','<p>Cuando llegaban los cinco días sin nombre conocidos como <strong>uayeb</strong>, los mayas no se bañaban, no hacían obras serviles o de trabajo, porque temían que al realizar alguna actividad, les iría mal.</p>'),(1,'Pop','Mat (símbolo de comunidad y matrimonio)','Uinal_1','<p>Este mes era una especie de año nuevo, era una fiesta muy celebrada, renovaban todas las cosas de utensilios de casa, como platos, vasos, banquillos, ropa, mantillas, barrían su casa y la asura la echaban fuera del pueblo, pero antes de la fiesta al menos <strong>13 </strong>días ayunaban y se abstenían de tener sexo, no comían sal, ni chile, algunas personas ampliaban este período de abstinencia  hasta tres uinales. Después todos los hombres se reunían con el sacerdote en el patio del templo y ponían una porción de copal en el brasero para quemarlo.</p>'),(2,'Uo','Rana','Uinal_2','<p>En este mes se realizaban festividades para sacerdotes, adivinadores, la ceremonia era llamada pocam, y oraban quemando copal a Kinich Ahau Itzamná, a quien consideraban el primer sacerdote. Con <em><strong>«agua virgen traída del monte, donde no llegase mujer»</strong></em> untaban las tablas de los libros y el sacerdote realizaba los pronósticos del año, realizaban un baile llamado okotuil.</p>'),(3,'Zip','Rojo','Uinal_3','<p>En este mes se juntaban los sacerdotes con sus mujeres, y usaban idolillos de la diosa <strong>Ixchel</strong>, y la fiesta se llamaba<strong> Ibcil Ixchel</strong>, invocaban a los dioses de la medicina que eran <strong>Itzamná</strong>, <strong>Citbolontun </strong>y <strong>Ahau Chamahez</strong>, realizaban un baile llamado Chantunyab. El día siete del uinal zip día invocaban a los dioses de la caza <strong>Ah Cancum, Zuhuyzib Zipitabai</strong>, y otros, cada cazador sacaba una flecha y una cabeza de venado las cuales eran untadas de betún azul, y bailaban con las flechas en las manos, se horadaban las orejas, otros la lengua y pasaban por los agujeros siete hojas de una hierba llamada <strong>Ac</strong>. Al día siguiente era el turno de los pescadores, pero ellos untaban de betún azul sus aparejos de pesca y no se horadaban las orejas, sino que se ponían arpones, y bailaban el <strong>Chohom</strong>, y después de realizada la ceremonia iban a la costa a pescar, los dioses eran <strong>Abkaknexoi, Abpua, y Ahcitzamalcun</strong>.</p>'),(4,'Sots','Bat','Uinal_4','<p>En este mes los apicultores comenzaban los preparativos pero celebraban su fiesta en el uinal siguiente <strong>tsek</strong>, los sacerdotes y oficiales ayunaban, así como algunos voluntarios.</p>'),(5,'Tsek','-','Uinal_5','<p>En este mes no derramaban <strong>sangre</strong>, los dioses venerados eran los cuatro <strong>bacabs</strong>, especialmente <strong>Hobnil</strong>. Ofrecían a los <strong>bacabs </strong>platos con figuras de miel, y los mayas bebían un vino llamado balche, el cual se procesaba de la corteza del árbol de ese nombre<em> (Lonchucarpus violaceus)</em>, los apicultores regalaban miel en abundancia.</p>'),(6,'Xul','Perro','Uinal_6','<p>Este mes era dedicado a <strong>Kukulcán</strong>, los mayas iban por el jefe supremo de los guerreros llamado <strong>Nacom</strong>, al cual sentaban en el templo quemando copal, realizaban un baile de guerreros llamado <strong>Holkanakot</strong>, sacrificando un perro y quebrando ollas llenas de bebida para terminar su fiesta, y regresar con honores al <strong>Nacom </strong>a su casa. Esta ceremonia se celebraba en todos lados hasta la destrucción de <strong>Mayapán</strong>, después solo se celebraba en Maní en la jurisdicción de los <strong>Tutul xiúes</strong>, todos los señores se juntaban presentaban cinco banderas de pluma, y se iban al templo de <strong>Kukulcán</strong>, donde oraban durante cinco días, después de los cuales bajaba <strong>Kukulcán </strong>del cielo y recibía las ofrendas, la fiesta se llamaba <strong>Chikabán</strong>.</p>'),(7,'Yaxkin','Primer Sol (o verde)','Uinal_7','<p>En este mes se realizaba la ceremonia se llamaba <strong>Olob-Zab-Kamyax</strong>, se untaban todos los instrumentos de todos los oficios con betún azul, se juntaban los niños y las niñas del pueblo y les daban unos golpecillos en los nudillos, con la idea que los niños fueran expertos en los oficios de sus padres. Desde este uinal comenzaban a aparejarse para la ceremonia del uinal <strong>Mol</strong>.</p>'),(8,'Mol','Agua o Jade','Uinal_8','<p>En este mes los apicultores oraban a los dioses para que hubiese buenas flores y de esta manera tener una buena producción de las abejas,.en este mes era cuando fabricaban las <strong>efigies </strong>o ídolos de madera, los cuales eran de alguna forma bendecidos por los sacerdotes. Se practicaba un ritual en el cual se<em> sangraban las orejas.</em></p>'),(9,'Chen','Cueva o pozo','Uinal_9','<p>En este mes hacían una fiesta llamaba <strong>ocná</strong>, que quiere decir <em>«renovación del templo»</em>, la hacían en honor de los dioses de los maizales; los mayas acostumbraban tener ídolos de los dioses con pequeños braseros en donde quemaban copal, en esta fiesta cada año se renovaban los ídolos de barro y sus braseros.</p>'),(10,'Yaxkin','verde o primero','Uinal_10','<p>En este mes hacían una fiesta llamaba <strong>ocná</strong>, que quiere decir <em>«renovación del templo»</em>, la hacían en honor de los dioses de los maizales; los mayas acostumbraban tener ídolos de los dioses con pequeños braseros en donde quemaban copal, en esta fiesta cada año se renovaban los ídolos de barro y sus braseros.</p>'),(11,'Sak','Blanco','Uinal_11','<p>En este mes el sacerdote y los cazadores hacían una ceremonia para aplacar a los dioses de la ira, y como una forma de penitencia por la sangre derramada durante la cazas (los mayas tenían como <em>«cosa horrenda»</em> cualquier derramamiento de sangre si dicho derramamiento no era en sus sacrificios), por eso cuando iban a la caza invocaban al dios de la caza, le quemaban copal y si podían le untaban al rostro del ídolo de la caza, la sangre del corazón de la presa.</p>'),(12,'Keh','Rojo (ciervo)','Uinal_12','<p>En las proximidades de este mes existía una fiesta muy grande y de fecha movible que duraba tres días, con quema de copal, a la cual Landa llamaba <strong><em>«sahumerías»</em></strong>, ofrendas y borrachera. Los sacerdotes tenían cuidado de avisar con tiempo para realizar un ayuno previo</p>'),(13,'Mak','Para cerrar, para cubrir','Uinal_13','<p>En este mes la gente anciana realizaba una ceremonia llamada <strong>«tupp kak»</strong> <em>(matar el fuego)</em>, era dirigida a los dioses de los panes y a Itzamná, en una fogata quemaban corazones de aves y animales, una vez incinerados los corazones apagaban el fuego con cántaros de agua. Se juntaba el pueblo y los sacerdotes y untaban con lodo y betún azul los primeros escalones de las escaleras de sus templos. En esta fiesta no realizaban ayuno, a excepción del sacerdote</p>'),(14,'Kankin','Sol amarillo','Uinal_14','<p>Hasta la fecha se desconocen los <em>dioses </em>que se honraban en este periodo del año maya</p>'),(15,'Muan','El pajaro gemido','Uinal_15','<p>Este mes correspondía a los cultivadores de cacao realizar una ceremonia a los dioses <strong>Chac Ek chuah, </strong>y<strong> Hobnil</strong>, sacrificaban un perro manchado con el color de cacao, y quemaban incienso y ofrecían iguanas de las azules<em> (probablemente untadas de betún azul)</em> y ciertas plumas de pájaros, terminada la ceremonia los mayas se comían las ofrendas.</p>'),(16,'Pax','Tiempo de siembra','Uinal_16','<p>En este mes la ceremonia se llamaba<strong> pacum chac</strong>, y por un período de cinco noches se juntaban los señores <em>(batab)</em> y los sacerdotes (ah kin) de los pueblos menores <em>(batabil)</em>, en las capitales y veneraban a <strong>Cit chac cob</strong>. Se homenajeaba con copal al jefe de los guerreros <em>(nacom)</em> durante cinco días, realizaban un baile de los guerreros llamado <strong>HOLKANAKOT</strong>. El sentido de esta ceremonia era para pedir a sus dioses alcanzar la victoria frente a sus enemigos. Se sacrificaba un perro, al cual se le extraía el corazón, se rompían ollas grandes que contenían bebida, y daban por finalizada la ceremonia, regresando a sus pueblos.</p>'),(17,'Kayab','Tortuga','Uinal_17','<p>Durante los meses <strong>kayab </strong>y <strong>Kumku </strong>en cada población hacían fiestas a las cuales llamaban <strong>zabacilthan</strong>, se reunían para presentar ofrendas, comer y beber preparándose para el <strong><em>uayeb</em></strong>, el mes corto de los cinco días nefastos. </p>'),(18,'Kumku','Maiz maduro','Uinal_18','<p>Durante los meses <strong>kayab </strong>y <strong>Kumku </strong>en cada población hacían fiestas a las cuales llamaban <strong>zabacilthan</strong>, se reunían para presentar ofrendas, comer y beber preparándose para el <strong><em>uayeb</em></strong>, el mes corto de los cinco días nefastos. </p>');
